script: |
  super -f text -I q10402.spq | sort > q10402.out

inputs:
  - name: q10402.spq
    data: |
      SELECT DISTINCT - 14, 18 AS col2 FROM tab1 (FORMAT parquet) WHERE NOT - col2 BETWEEN - + col0 * + CAST ( - col0 AS INTEGER ) AND - 99;
  - name: tab1

outputs:
  - name: q10402.out
    data: |
      -14	18
